mapper.select:

select 

from FWDRST
where FWDRST_TX_DATE = #{fwdrstTxDate,jdbcType=CHAR}
  and FWDRST_TX_ID = #{fwdrstTxId,jdbcType=CHAR}
  and FWDRST_RUN_NO = #{fwdrstRunNo,jdbcType=DECIMAL}

mapper.delete:

delete from FWDRST
where FWDRST_TX_DATE = #{fwdrstTxDate,jdbcType=CHAR}
  and FWDRST_TX_ID = #{fwdrstTxId,jdbcType=CHAR}
  and FWDRST_RUN_NO = #{fwdrstRunNo,jdbcType=DECIMAL}

mapper.update:

update FWDRST
set FWDRST_EJFNO = #{fwdrstEjfno,jdbcType=VARCHAR},
  FWDRST_REPLY_CODE = #{fwdrstReplyCode,jdbcType=VARCHAR},
  FWDRST_TXRUST = #{fwdrstTxrust,jdbcType=CHAR},
  FWDRST_CBS_RRN = #{fwdrstCbsRrn,jdbcType=VARCHAR},
  FWDRST_CBS_TX_CODE = #{fwdrstCbsTxCode,jdbcType=VARCHAR},
  FWDRST_ERR_MSG = #{fwdrstErrMsg,jdbcType=VARCHAR},
  UPDATE_USERID = #{updateUserid,jdbcType=INTEGER},
  UPDATE_TIME = #{updateTime,jdbcType=TIMESTAMP}
where FWDRST_TX_DATE = #{fwdrstTxDate,jdbcType=CHAR}
  and FWDRST_TX_ID = #{fwdrstTxId,jdbcType=CHAR}
  and FWDRST_RUN_NO = #{fwdrstRunNo,jdbcType=DECIMAL}
